    false,nt"url": null,nt"notes": "The Atchafalaya Basin (Water and Land Resources),
    Louisiana, study is being conducted in response to resolutions adopted by the United
    States Senate and House of Representatives on March 23 and June 14, 1972, respectively.
    These resolutions directed the U.S. Army Corps of Engineers "to develop...a comprehensive
    plan for the preservation and management of the water and land resources of the
    Atchafalaya River Basin, which would include provisions for the reduction of siltation,
    improvement of water quality, and possible improvement of the area for commercial
    and sport fishing." At the present time, study alternatives contain two features,
    water management units and land use easements, which are capable of contributing
    to the accomplishment of these goals. This planning aid report analyzes the potential
    contribution of these features to fish and wildlife resource preservation and is
    submitted to the New Orleans District Corps of Engineers under provisions of the
    Fish and Wildlife Coordination Act (48 Stat. 401, as amended; 16 U.S.C. 661 et seq.).",nt"owner_org":
